import React, {Component} from 'react'
import data from "./sectionInfo.json"

class DisplayTable extends Component {

    render() {
        return (
            
            <div className="App">
                <h1>Users list</h1>
                    {data.map(user => (
                        <li key={user.id}>{user.name}</li>
                    ))}
            </div>
        )
    }
        

    
}
    
export default DisplayTable
